import React, {useState} from "react"
import './loginForm.css'

export const  LoginForm = (props) => {

const[token, setToken]  = useState('');
const[email, setEmail]  = useState('')
const [number, setNumber] = useState('')




const handleSubmit = (e) => {
e.preventDefault();
	console.log(token);

}
    return (
		
		 <div className="auth-form-container">
		 <div>
			<h2 className="head-text">Check your email/sms for verification</h2>
			<form className="login-form" onSubmit={handleSubmit}>
			<label htmlFor="token">Token</label>
			<input value={token} onChange={(e) => setToken(e.target.value)}  type="text" placeholder="Enter token to view" id="token" name="token"></input>
			<button className="verify-btn" type="submit">Verify</button>
			</form>
			<button className="click-btn" onClick={() =>  props.onFormSwitch("registerForm")}>Don't have a token? Click here</button>
		 </div>
		 <div>
		 <h2 className ="head-text">Enter Number or Email to recieve token</h2>
             <form className="login-form"  onSubmit={handleSubmit}>
           <label htmlFor="email">Email</label>
		   <input value={email} onChange={(e) => setEmail(e.target.value)}  type="email" placeholder="youremail" id="email" name="email"></input>
		   <label htmlFor="number">Number</label>
		   <input value={number} onChange={(e) => setNumber(e.target.value)}  type="tel" placeholder="number" id="number" name="number"></input>
		   <button  className="send-btn"  type="submit">Send</button>
		 </form>
		<button className="link-btn" onClick={() =>  props.onFormSwitch("loginForm")}>Already have a token? click here</button>
		 </div>
		</div>
		
    
    )
}
export default LoginForm;
